  <>
    <a href={url}>
      <img src={img} />
    </a>
    <style jsx>
      {`
        img {
          width: 530px;
          height: 330px;
        }

        img:hover {
          transform: scale(1.1);
          transition: 1s all;
        }
      `}
    </style>
  </>
);

export default SlideImages;
